//Função Limpa inputs
function clean() {
    $locador.value = '';
    $imovel.value = '';
    $referencia.value = '';
    $valorCredito.value = '';
    $comissao.value = '';
    $credito.value = '';
    $valorDebito.value = '';
    $debito.value = '';
    $valorCredito.value = '';
    resultadoCredito = 0;
    resultadoDebito = 0
    CleanArray()

}

function CleanArray() {
    for (var i = 0; i < ArrayCredito.length;) {
        ArrayCredito.shift(ArrayCredito[i])
    }
    for (var i = 0; i < ArrayDebito.length;) {
        ArrayDebito.shift(ArrayDebito[i])
    }

    for (var i = 0; i < ArrayCreditoInformacao.length;) {
        ArrayCreditoInformacao.shift(ArrayDebito[i])
    }

    for (var i = 0; i < ArrayDebitoInformacao.length;) {
        ArrayDebitoInformacao.shift(ArrayDebitoInformacao[i])
    }

}

/*CONVERSORES*/
function ConversorComissao() {
    let TransValor = $comissao.value;
    let transform = TransValor.replace(/\./g, "");
    transform = transform.replace(/,/g, ".");
    return Number(transform)
}

function ConversorDebito() {
    let TransValor = $valorDebito.value;
    let transform = TransValor.replace(/\./g, "");
    transform = transform.replace(/,/g, ".");
    return Number(transform)
}

function ConversorCredito() {
    let TransValor = $valorCredito.value;
    let transform = TransValor.replace(/\./g, "");
    transform = transform.replace(/,/g, ".");
    return Number(transform)
}

/* SOMAR VALORES DENTRO DA ARRAY DÉBITO*/
function SomarDebitoTotal() {
    for (let i = 0; i < ArrayDebito.length; i++) {
        resultadoDebito += ArrayDebito[i]
    }
    return
}

/* SOMAR VALORES DENTRO DA ARRAY CRÉDITO*/
function SomarCreditoTotal() {
    for (let i = 0; i < ArrayCredito.length; i++) {
        resultadoCredito += ArrayCredito[i]
    }
    return
}

//Adicionar Valores na Array

function AddDebito() {
    ArrayDebito.push(ConversorDebito())
}

function AddCredito() {
    ArrayCredito.push(ConversorCredito())
}

function AddDebitoInformacao() {
    ArrayDebitoInformacao.push({ debito: $debito.value, valor: $valorDebito.value })

}

function AddCreditoInformacao() {
    ArrayCreditoInformacao.push({ credito: $credito.value, valor: $valorCredito.value })

}

function CriarTabelaDebito() {
    let li = document.createElement('li');
    li.innerHTML = $debito.value;
    let span = document.createElement('span');
    span.innerHTML = $valorDebito.value;
    li.appendChild(span);
    return li

}

function CriarTabelaCredito() {
    let li = document.createElement('li');
    li.innerHTML = $credito.value;
    let span = document.createElement('span');
    span.innerHTML = $valorCredito.value;
    li.appendChild(span);
    return li

}

function AdicionarDebito() {
    let li = CriarTabelaDebito();
    $adicionaDebito.appendChild(li);

}

function AdicionarCredito() {
    let li = CriarTabelaCredito();
    $adicionaCredito.appendChild(li);

}

//Calculo TOTAL: 
function calculoTotal() {
    SomarDebitoTotal()
    SomarCreditoTotal()
    let resultado = resultadoCredito - (resultadoDebito + ConversorComissao());
    return resultado
}


